from pyevmasm import disassemble_hex
from pyevmasm import assemble_hex
import time

class Instruction:
    def __init__(self, offset, operation, data=None):
        self.operation = operation
        # convert offset to hex
        self.offset = hex(offset)
        self.data = data
    
    def print(self):
        # format offset to 4 digits like 0x0012
        # format the data to the corrent length according to the type of PUSH
        # if push_length is 4, then data should be padded to 8 digits
        if self.operation.startswith('PUSH'):
            push_length = int(self.operation[4:])
            print(f'0x{self.offset[2:].zfill(4)} {self.operation} 0x{self.data[2:].zfill(push_length*2)}')
        else:
            print(f'0x{self.offset[2:].zfill(4)} {self.operation}')


def disassemble(bytecode):
    # if bytecode starts with 0x, remove it
    if bytecode.startswith('0x'):
        bytecode = bytecode[2:]
    
    opcode_view = disassemble_hex(bytecode).split('\n')
    
    instrucsions = []
    current_offset = 0
    for opcode in opcode_view:
        # if it is not PUSH operation
        if not opcode.startswith('PUSH'):
            instrucsions.append(Instruction(current_offset, opcode))
            current_offset += 1
        # if it is PUSH operation
        else:
            operation, data = opcode.split(' ')
            instrucsions.append(Instruction(current_offset, operation, data))
            current_offset += int(operation[4:]) + 1
    return instrucsions




